import { BrowserRouter, Routes,Route } from 'react-router-dom';
import './App.css';
import Navbar from './Components/navbar/navbar';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
     <Navbar></Navbar>
     <Routes> <Route path='/' element={<h1>Home</h1>}> </Route> </Routes>
     <Routes> <Route path='/MyProject' element={<h1>MyProject</h1>}> </Route> </Routes>
     <Routes> <Route path='/Message' element={<h1>Message</h1>}> </Route> </Routes>
     <Routes> <Route path='/Profile' element={<h1>Home</h1>}> </Route> </Routes>
     </BrowserRouter>
    </div>
  );
}

export default App;
